import React from 'react';



const Fetchpokemon = ({data}) => {

    var pokemonid = [];
    data.url.forEach((url)=>{
    	fetch(url)
    	.then(resp => resp.json())
    	.then(info=>pokemonid.push(info.id))

    })

    var display =[];
    pokemonid.forEach(value=>{
        display.push(<li key = {pokemonid.indexOf(value)}>{value}</li>)

    })
    return display;
}



export default Fetchpokemon;
